script: |
  super -f text -I q5450.spq | sort > q5450.out

inputs:
  - name: q5450.spq
    data: |
      SELECT - col0 * col2 FROM tab1 (FORMAT parquet) WHERE NOT 94 NOT BETWEEN + 27 AND + ( - 60 ) + + col0 * col0;
  - name: tab1

outputs:
  - name: q5450.out
    data: |
      -4896
      -5015
      -6188
